import React, {useEffect,useState} from 'react';

const MatchDetails = () => {
    const [matches, setMatches] = useState(null);

        useEffect(() => {
            const fetchMatches = async () => {
                const response = await fetch('/api/matches');
                const json = await response.json()

                if(response.ok){
                    setMatches(json)
                }
            }

            fetchMatches()
        }, [])

    const [athleteBlue, setAthleteBlue] = useState(null)

        useEffect((matches) => {
            const fetchAthleteBlue = async () => {
                const response = await fetch(`/api/athletes/getbyid/${matches.athleteBlueId}`)
                .then(response => response.json())
                .then(data => {
                    setAthleteBlue(data)
                })
            }

            fetchAthleteBlue()
        }, []);

    return (
        <div>
            {matches && matches.map((matches) => (
                <>
                    <div key={matches.matchNo}>{matches.matchNo}</div>
                    <div>{athleteBlue.forename}{athleteBlue.surname}</div>
                </>
            ))}
        </div>
    );
}

export default MatchDetails;
